import React from 'react'

const TableData = ({ tableData }) => {
    return (
        <div>
            <table>
                <tr>
                    {
                        tableData?.header?.map(el=>{
                            return(
                                <th>Company</th>
                            )
                        })
                    }
                </tr>
                <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Germany</td>
                </tr>
            </table>
        </div>
    )
}

export default TableData;
